import { makeStyles } from "@mui/styles";

export const useStyle = makeStyles((theme) =>({
    navList: {
        minWidth: "50px",
        cursor:"pointer",
        userSelect:"none"
    },
    navAvtar:{
        width:"35px",
        height:"35px"
    },
    ulAvtar:{
        backgroundColor:"blue"
    }
}));
